import React from 'react';
import LandingBox from './LandingBox';
import {Card} from 'react-materialize';
import './LandingPage.css';

function LandingPage() {
    return (
        <div class="row">
            <div class="col s7">
            </div>
            <div class="col s3">
                <div class="valign-wrapper">
                    <LandingBox />
                </div>
            </div>
            <div class="col s2">
            </div>
        </div>
    );
}

export default LandingPage;
